      out.write("                        $self.$window.on('scroll', function () {\n");
      out.write("                            $self.$scrollTop = parseInt($self.$window.scrollTop());\n");
      out.write("                            if ($self.$scrollTop >= $self.$windowHeight) {\n");
      out.write("                                if (!$self.$target.hasClass('on')) {\n");
      out.write("                                    $self.position();\n");
      out.write("                                    $self.$target.addClass('on');\n");
      out.write("                                    $self.showAction();\n");
      out.write("                                }\n");
      out.write("                            } else {\n");
      out.write("                                if ($self.$target.hasClass('on')) {\n");
      out.write("                                    $self.position();\n");
      out.write("                                    $self.$target.removeClass('on');\n");
      out.write("                                    $self.hideAction();\n");
      out.write("                                }\n");
      out.write("                            }\n");
      out.write("                        });\n");
      out.write("\n");
